package cryptorandomstring

import "testing"

func TestGenerate(t *testing.T) {
	tests := []struct {
		name    string
		want    string
		wantErr bool
	}{
		{
			name:    "Generate",
			want:    "",
			wantErr: false,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			got, err := Generate()
			if (err != nil) != tt.wantErr {
				t.Errorf("Generate() error = %v, wantErr %v", err, tt.wantErr)
				return
			}
			if got != tt.want {
				t.Errorf("Generate() got = %v, want %v", got, tt.want)
			}
		})
	}
}

func TestGenerator_Generate(t *testing.T) {
	type fields struct {
		length     uint64
		kind       string
		characters string
	}
	tests := []struct {
		name    string
		fields  fields
		want    string
		wantErr bool
	}{
		{
			name:    "GenerateWithKindAndCharacters",
			fields:  fields{kind: "hex", characters: "abc"},
			want:    "",
			wantErr: true,
		},
		{
			name:    "GenerateWithUnknownType",
			fields:  fields{kind: "abc"},
			want:    "",
			wantErr: true,
		},
		{
			name:    "GenerateWithMoreThan65536Characters",
			fields:  fields{characters: ""},
			want:    "",
			wantErr: true,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			g := &Generator{
				length:     tt.fields.length,
				kind:       tt.fields.kind,
				characters: tt.fields.characters,
			}
			got, err := g.Generate()
			if (err != nil) != tt.wantErr {
				t.Errorf("Generate() error = %v, wantErr %v", err, tt.wantErr)
				return
			}
			if got != tt.want {
				t.Errorf("Generate() got = %v, want %v", got, tt.want)
			}
		})
	}
}
